- input: "TEXT\x1CC00358663\x1C57046D0F-20EB-4D74-A\x1C\x1CF3XN\x1COperating expenditures
    listed in the report were incurred on behalf of ARDA-ROC PAC.  If a contribution
    was made to, or an expenditure made on behalf of, another committee, that would
    be noted in the report.  ARDA-ROC PAC leases a box at Nationals Park that is used
    for PAC related events.  ARDA-ROC PAC pays the usual and normal charge for the
    box as determined by the Nationals baseball club.  Payments to the Nationals for
    the box are disclosed on ARDA-ROC PAC's FEC report as an operating expense during
    the period in which the expenditure is made.  On occasion ARDA-ROC PAC will make
    the box available for use by other organizations.  In such situations, ARDA-ROC
    PAC either pays for the suite and makes an in-kind contribution or receives payment
    from the organization using the box.  Should less than the full cost of the box
    is paid by the organization using the box, where required, the difference is reported
    by ARDA-ROC PAC as an in-kind contribution to that organization.   \n"
